  false,\n\t\"url\": null,\n\t\"notes\": \"The 2006 OSIP bare-earth Digital Elevation
  Model (DEM) was derived from digital LiDAR data was collected during the months
  of March and May (leaf-off conditions). The DEM data covers the entire land area
  of the northern tier of Ohio (approximately 23,442 square miles. The DEM is delivered
  in county sets, consisting of 5,000' x 5,000' size tiles that correspond to the
  tile sizes for the OSIP 1FT imagery products. Where the State borders other states
  (land only), the entire border of the State is buffered by at least 1,000-feet.
  Along the Lake Erie Shoreline ortho coverage is buffered beyond the shoreline a
  minimum distance of 2,500-feet. The file naming convention is as follows: Nxxxxyyy
  = 5,000' x 5,000' Tiles located in the Ohio State Plane Coordinate System (North
  Zone). Sxxxxyyy = 5,000' x 5,000' Tiles located in the Ohio State Plane Coordinate
  System (South Zone). Please note that xxxx and yyy represent the easting and northing
  coordinates (respectively) in state plane feet, The naming convention for each tile
  is based upon (the bottom most-left pixel). The full county mosaic is an aggregation
  of the tiles by county. The mosaic is devloped in the Ohio State Plane Coordinate
  System (North Zone).. The DEM tiles were provided in ESRI ArcINFO GRID raster and
  ASCII grid formats, with only the LiDAR in LAS Format containing the above ground
  and bare-earth LiDAR features. Ownership of the data products resides with the State
  of Ohio. Orthophotography and ancillary data products produced through this contract
  are public domain data. The LiDAR used to generate the DEM was acquired Statewide
  to provide a solid and very accurate base to use during the image rectification
  process. This same LiDAR can be supplemented with 3D breaklines to generate 2-foot
  and/or 4/5-foot contours. The average post spacing between LiDAR points is 7-feet.
  The flying altitude was 7,300-feet AMT, with the targeted flying speed at 170 knots.\",\n\t\"license_title\":
